import React, { useState } from "react";
import { Form, Input } from "antd-mobile";
import { StyleSheet } from "react-native";

const Withdraw = () => {
  return (
    <Form layout="horizontal">
      <Form.Item
        label="短信验证码"
        extra={
          <div>
            <a>发送验证码</a>
          </div>
        }
      >
        <Input placeholder="请输入验证码" clearable />
      </Form.Item>
    </Form>
  );
};

export default Withdraw;
